import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class BucketService {
  constructor(private http: HttpClient) {}

  listBuckets() {
    return this.http.get('http://localhost:8080/listBuckets');
  }
  createBucket(bucketName: string) {
    return this.http.post('http://localhost:8080/createBucket', { bucketName });
  }

  deleteBucket(bucketName: string) {
    return this.http.post('http://localhost:8080/deleteBucket', { bucketName });
  }
}
